import React, { Component } from "react"

export default class NewSymptomForm extends Component {
    state = {
        name: "",
        intensity: "",
        date: "",
        time: "",
        notes: "",
        userId: ""
    }

    handleFieldChange = evt => {
        const stateToChange={};
        stateToChange[evt.target.id] = evt.target.value;
        this.setState(stateToChange);
    }
    render() {
        return (
            <>
            It's working!
            </>
        )
    }
}
